import React from 'react'

export default function FieldResult(title,value){

    return (
        <Box 
            sx={{
                backgroundColor:"green",
                height:"50px",
                color:"white",
                borderRadius:"10px",
                display:"flex",
                alignItems:"center",
                justifyContent:"center",
                fontSize:"1.3em",
                margin:"50px 0px"
                }}
        >
            <span>{title}: {value}%</span>
        </Box>
    )
    
}
